// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "./STRANDVoting.sol";
import "./STRANDRoles.sol";

contract STRANDToken {
    STRANDRoles internal Roles;
    STRANDVoting internal Voting;
    bool internal CanBurn;
    bool internal CanMint;
    uint256 internal InitialSupply;
    string internal Name;
    string internal Symbol;
    constructor() {
        Roles = new STRANDRoles();
        Roles.addRole(1, "OWNER", "Contract owners");
        Roles.assignRole(msg.sender, 1);
        Voting = new STRANDVoting();
    }
    function setTokenOptions(string memory name, string memory symbol, uint8 decimals, uint256 decimalsIndependentInitialSupply, bool canBurn, bool canMint) internal {
        CanBurn = canBurn;
        CanMint = canMint;
        Name = name;
        Symbol = symbol;
        InitialSupply = decimalsIndependentInitialSupply * 10 ** decimals;
    }

    function getRoles() public view returns (STRANDRoles) {
        return Roles;
    }
    function getVoting() public view returns (STRANDVoting) {
        return Voting;
    }
}
